// Import React and CSS
import React from 'react';
import './App.css';
// Import React Router components
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';

// Define components for your routes
function EvidencijaLovaca() {
    return <h2>Evidencija Lovaca</h2>;
}

function RasporedAktivnosti() {
    return <h2>Raspored Aktivnosti i Lova</h2>;
}

// Add more components for each route as needed...

function App() {
    return (
        <Router>
            <div className="App">
                <header className="App-header">
                    <h1>Aplikacija za lov</h1>
                    <div className="Menu">
                        <NavigationButton to="/popis-bodova" text="EVIDENCIJA LOVACA" />
                        <NavigationButton to="/raspored-aktivnosti" text="RASPORED AKTIVNOSTI I LOVA" />
                        {/* Add more NavigationButton components for each route */}
                    </div>
                </header>
                {/* Define routes */}
                <Routes>
                    <Route path="/" element={<EvidencijaLovaca />} />
                    <Route path="/raspored-aktivnosti" element={<RasporedAktivnosti />} />
                    {/* Add more Route components for each route */}
                </Routes>
            </div>
        </Router>
    );
}

// Modify the Button component to use Link from React Router
function NavigationButton({ to, text }) {
    return (
        <Link to={to} className="Button">
            {text}
        </Link>
    );
}

export default App;
